import * as React from 'react';
import { background, secondary } from './colors.js';
import { makeStyles } from '@mui/styles';
import { Typography, Button } from '@mui/material';
import { styled } from '@mui/system';

const useStyles = makeStyles((theme) => ({
  textTheme: {
    color: secondary,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
    fontSize: '1.75em',
    letterSpacing: '0.1em',
    display: 'block',
  },
  smallerTextTheme: {
    color: secondary,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
    fontSize: '0.75em',
    letterSpacing: '0.1em',
    marginTop: '20px',
    marginRight: '50px',
    display: 'block',
  },
}));

const TitleText = styled('div')({
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  flex: 1,
  flexDirection: 'column',
});

const firstLetter = { fontSize: '1.3em' };

function TitleContent() {
  const classes = useStyles();
  return (
    <TitleText>
      <div className={classes.textTheme}>hello</div>
      <div className={classes.smallerTextTheme}>hello</div>
      <div className={classes.smallerTextTheme}>helloa</div>
    </TitleText>
  );
}

export default TitleContent;
